  state ={
    personsName:[
      {name: "Foivos", age:28},
      {}
    ]
  }
  render() {
    return (
      <div className="App">
        <h1>To App pou arxizw kai katalavainw</h1>
        <PersonComponent name="Eui" />
        <PersonFun name="Foivos" age="29" />
      </div>
    );
  }
}

export default App;
